import React from "react";

function ImageAndText(props) {
  return (
    <div className={props.data.class == null ? 'content' : props.data.class}>
      <div className={props.data.wrapper == null ? 'wrapper' : props}>
        <h1 className={props.data.headingClass}>{props.data.heading}</h1>
        <section className= {props.data.sectionClass}>{props.data.section}</section>
      </div>
      {props.data.source !== null ? <img src={props.data.source} className={props.data.imgClass} /> : ""}
    </div>
  );
}

export default ImageAndText;
